import React from "react";

const Footer = () => {
  return (
    <>
      <footer className="bg-light text-center">
        <p>
          Copyrights @ 2021 TFP Solutions Bangladesh Ltd. All Rights Reserved |
          Terms and Conditions.
        </p>
      </footer>
    </>
  );
};

export default Footer;
